import React from 'react';
import ReactDOM from 'react-dom';

const name = "Rahul";
const img1 = "https://picsum.photos/500";
ReactDOM.render(
  <>
  <h1 contentEditable="true">  My name is {name}  </h1>
  <img src={img1} 
  alt="Random Images"/>
  </>,
  document.getElementById('root')
);
